import React, {useEffect, useState} from 'react';
import {Routes, Route} from 'react-router-dom';

const App = () => {
  return (
    <div className="container">
      <Routes>
        <Route path="/"
               exact
               element={<Home/>}/>
      </Routes>
    </div>
  );
}

export default App;
